import {Editique} from "./Editique";

export class Releve extends Editique {
  profil: string = '';
  constructor(doc_key: string, output_format: string, data: any) {
    data.content = data?.content ?? '';
    super('releves_notes', 'pdf', data);
  }

  override prepare(user: any) {
    super.prepare(user);

    // Image profile
    this.add({ id: 'photo', type: 'image', extension: 'jpg', content: this.profil });

    // Session
    this.add({ id: 'session', type: 'text', value: this.data.rn?.session ?? '--' });

    // Série
    this.add({ id: 'serie', type: 'text', value: this.data.rn?.serial_tag ?? '--' });

    // Centre
    this.add({ id: 'centre', type: 'text', value: this.data.rn?.center_name ?? '--' });

    // S/Centre
    this.add({ id: 'scentre', type: 'text', value: this.data.rn?.scenter_name ?? '--' });

    // Non/Prénom
    this.add({ id: 'nom_prenom', type: 'text', value: user.identite.nomUsage.toUpperCase() + ' ' + user.identite.prenom });

    // N° table
    this.add({ id: 'n_table', type: 'text', value: this.data.rn?.n_table ?? '--' });

    // Date de naissance
    let birthday = new Date(user?.identite.dateNaissance);
    this.add({ id: 'date_naissance', type: 'text', value: birthday.toLocaleDateString() });

    // Lieu de naissance
    this.add({ id: 'lieu_naissance', type: 'text', value: user?.identite.lieuNaissance ?? '--' });

    // N° CNE/NIN
    this.add({ id: 'nin', type: 'text', value: user?.identite.nie ?? '--' });

    // Titre session
    this.add({ id: 'titre_session', type: 'text', value: 'Epreuves du 1er groupe'.toUpperCase() });

    // Tableau des notes
    if (Array.isArray(this.data.notes)) {
      let rows: any[] = [];
      let total_coef: number = 0;
      let total_notes: number = 0;
      this.data.notes.forEach(
        (row: any) => {
          const m = this.data.matters.filter(
            (i: any) => {
             return i.id == row.matter;
            }
          ).at(0);
          if (m) {
            rows.push({ tr: [ { value: m.label, styles: { text: { position: { align: 'left' } } } }, { value: row.note }, { value: m.coef }, { value: row.note * m.coef }] });
            total_coef += Number(m.coef);
            total_notes += Number(row.note) * Number(m.coef);
          }
        }
      );

      // Totaux
      rows.push({
        tr: [
          { value: 'Total', colspan: 2, styles: { text: { font: { bold: true } } } },
          { value: total_coef, styles: { text: { font: { bold: true } } } },
          { value: total_notes, styles: { text: { font: { bold: true } } } }]
      });

      // Moyenne
      const moy = Math.fround(total_notes / total_coef);
      rows.push({
        tr: [
          { value: 'Moyenne / 20', colspan: 2, styles: { text: { font: { bold: true } } } },
          { value: moy.toFixed(2), colspan: 2, styles: { text: { font: { bold: true } } } }]
      });

      let table: any = {
        id: 'table_resultats',
        type: 'table',
        value: {
          header: [
            { tr: [ { value: 'Nature des Epreuves' }, { value: 'Notes/20'}, { value: 'Coef.'}, { value: 'Notes définitives'} ] }
          ],
          body: rows
        }
      };
      this.add(table);

      // Date edition
      this.add({ id: 'date_edition', type: 'text', value: this.ruleService.dateEdition(this.data.rn) });

      // Decision du Jury
      this.add({ id: 'decision', type: 'text', value: this.ruleService.decision(moy) });
    }
  }
}
